import React, { Component } from 'react'

export default class Category extends Component {

    state={
        list:null
    }

    componentDidMount(){
        fetch('http://localhost:8080/login').then((resp) => {
            resp.json().then((data) => {
                console.log(data)
                this.setState({
                    list:data
                })
            })
        })
    }

    render() {
        return (
            <div>

            <TextField
            id="standard-select-currency"
            select
            label="Restaurant Category"
            name="categoryId"
            value={this.state.categoryId}
            onChange={this.handleChange}
            helperText="Select The Category"
            variant="outlined"
            fullWidth
            color="secondary"
            margin="normal"
            size="small"
          >
            {
                    this.state.list.map((cat,i) => {
                        return(
                            <div key={cat.name}>
                                {cat.id}
                            </div>
                        );
                    })
                }
          </TextField>
                
            </div>
        )
    }
}
